function createGuineaPig() {
  guineaPig = new GuineaPig();
  guineaPig.mesh.rotation.y = Math.PI/2;
  scene.add(guineaPig.mesh);
  guineaPig.nod();
}
    
function createTomato(){
  tomato = new Tomato();
  scene.add(tomato.mesh);   
}
    
function createPotato(){
  potato = new Potato();
  scene.add(potato.mesh);
}

function createAvacado(){
  avacado = new Avacado();
  avacado.mesh.position.y += 30;
  scene.add(avacado.mesh);
}
    
function createPepper(){
  pepper = new Pepper();
  pepper.mesh.position.y+=30;
  scene.add(pepper.mesh)
}


Fir = function() {
  var height = 200;
  var truncGeom = new THREE.CylinderGeometry(2,2,height, 6,1);
  truncGeom.applyMatrix(new THREE.Matrix4().makeTranslation(0,height/2,0));
  this.mesh = new THREE.Mesh(truncGeom, greenMat);
  this.mesh.castShadow = true;
}

var firs = new THREE.Group();

function createFirs(){
  
  var nTrees = 1000;
   for(var i=0; i< nTrees; i++){
    var phi = i*(Math.PI*2)/nTrees;
    var theta = Math.PI/2;
    //theta += .25 + Math.random()*.3; 
    theta += (Math.random()>.05)? .25 + Math.random()*.3 : - .35 -  Math.random()*.1;
   
    var fir = new Tree();
    fir.mesh.position.x = Math.sin(theta)*Math.cos(phi)*floorRadius;
    fir.mesh.position.y = Math.sin(theta)*Math.sin(phi)*(floorRadius-10);
    fir.mesh.position.z = Math.cos(theta)*floorRadius; 
     
    var vec = fir.mesh.position.clone();
    var axis = new THREE.Vector3(0,1,0);
    fir.mesh.quaternion.setFromUnitVectors(axis, vec.clone().normalize());
    floor.add(fir.mesh); 
  }
}


function updateTomatoPosition(){
    removeParticle(disappearMagic.mesh);
    tomatoAngle = tomatoAngle + Math.PI/200;
    tomato.mesh.position.y = -50+Math.sin(tomatoAngle)*100;
    tomato.mesh.position.x = +Math.cos(tomatoAngle)*(100);
    tomato.mesh.position.z = guineaPig.mesh.position.z;
}
    
function updatePotatoPosition(){
    removeParticle(disappearMagic.mesh);
    potatoAngle = potatoAngle + Math.PI/200;
    potato.mesh.position.y = -50+Math.sin(potatoAngle)*100;
    potato.mesh.position.x = +Math.cos(potatoAngle)*(100);
    potato.mesh.position.z = guineaPig.mesh.position.z;
}

function updatePepperPosition(){
    removeParticle(disappearMagic.mesh);
    pepperAngle = pepperAngle + Math.PI/200;
    pepper.mesh.position.y = -80+randomizer+Math.sin(pepperAngle)*100;
    pepper.mesh.position.x = +Math.cos(pepperAngle)*(100);
    pepper.mesh.position.z = guineaPig.mesh.position.z;
}
    
function updateAvacadoPosition(){
    avacadoAngle = avacadoAngle + Math.PI/180;
    removeParticle(disappearMagic.mesh);
    avacado.mesh.position.y = -80+Math.sin(avacadoAngle)*100;
    avacado.mesh.position.x = +Math.cos(avacadoAngle)*(100);
}    

function updateFloorRotation(){
  floorRotation += 0.003 * speed;
  floorRotation = floorRotation%(Math.PI*2);
  floor.rotation.z = floorRotation;
}


function createDisappearMagic(){
    disappearMagic = new DisappearMagic();
    disappearMagic.mesh.visible = false;
    scene.add(disappearMagic.mesh);
}


function checkCollision(){
  var tomatoPoint = guineaPig.mesh.position.clone().sub(tomato.mesh.position.clone());
  var potatoPoint = guineaPig.mesh.position.clone().sub(potato.mesh.position.clone());
  var avacadoPoint = guineaPig.mesh.position.clone().sub(avacado.mesh.position.clone());
  var pepperPoint = guineaPig.mesh.position.clone().sub(pepper.mesh.position.clone());
    
  if (tomatoPoint.length() < collisionBonus ){ 
    hitTomato();
   
  } 
  
  if (potatoPoint.length() < collisionBonus ){ 
    hitPotato();
  }
  
   if (avacadoPoint.length() < collisionBonus ){ 
    hitAvacado();     
   }
    if (pepperPoint.length() < collisionBonus){  
    hitPepper();
    randomizer = Math.random()*20; 
  } 

}

function getBonus(){
  bonusParticles.mesh.visible = true;
  bonusParticles.explose();
  monsterPosTarget += .025;
  
}

function hitTomato(){
  disappearMagic.mesh.position.copy(tomato.mesh.position);
  disappearMagic.mesh.visible = true;
  tomatoAngle += Math.PI/(2*Math.random());
    console.log("Hit Tomato!")
}

function hitPotato(){
  disappearMagic.mesh.position.copy(potato.mesh.position);
  disappearMagic.mesh.visible = true;
  potatoAngle += Math.PI/(2*Math.random());
  score = score - 1;
  console.log("Hit Potato!") 
}

function hitAvacado(){
  disappearMagic.mesh.position.copy(avacado.mesh.position);
  disappearMagic.mesh.visible = true;
  avacadoAngle += Math.PI/(2*Math.random());
  score = score -1;
  console.log("Hit Avacado") 
}

function hitPepper(){
  disappearMagic.mesh.position.copy(pepper.mesh.position);
  disappearMagic.mesh.visible = true;
  pepperAngle += Math.PI/(2*Math.random());
  score = score +1;
  console.log("Avacado") 
}

function updateDistance(){
  distance += speed;
  var d = distance/2;
}


function loop(){
  delta = clock.getDelta();
  updateFloorRotation();
  
  if (gameStatus == "play"){
    

    updateDistance();
    updateTomatoPosition();
    updatePotatoPosition();
    updateAvacadoPosition();
    updatePepperPosition();
    checkCollision();
    if (score <= 0){
    x.a = 0;}
  }
  
  render();  
  requestAnimationFrame(loop);
}

function render(){
  renderer.render(scene, camera);
}

window.addEventListener('load', init, false);

function init(event){
  initScreenAnd3D();
  createLights();
  createFloor()
  createGuineaPig();
  createFirs();
  createTomato();
  createAvacado();
  createPepper();
  createPotato();
  createDisappearMagic();
  initUI();
  resetGame();
  loop();
  
}

function resetGame(){
  scene.add(guineaPig.mesh);
  guineaPig.mesh.rotation.y = Math.PI/2;
  guineaPig.mesh.position.y = 0;
  guineaPig.mesh.position.z = 0;
  guineaPig.mesh.position.x = 0;

  monsterPos = .56;
  monsterPosTarget = .65;
  speed = initSpeed;
  level = 0;
  distance = 0;
  gameStatus = "play";
  guineaPig.status = "running";
  guineaPig.nod();
}

function initUI(){
  fieldGameOver = document.getElementById("gameoverInstructions");
  
}



